import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { OrderService } from '../core/services/order.service';
import { OrderResponse } from '../core/models/order.model';

@Component({
  selector: 'app-order-history',
  standalone: true,
  templateUrl: './order-history.component.html',
  styleUrls: ['./order-history.component.css']
})
export class OrderHistoryComponent implements OnInit {
  orders: OrderResponse[] = [];
  loading = false;
  error: string | null = null;
  page = 1;
  pageSize = 10;
  totalCount = 0;

  constructor(private orderService: OrderService) {}

  ngOnInit() {
    this.fetchOrders();
  }

  fetchOrders() {
    this.loading = true;
    this.error = null;
    this.orderService.getPagedOrders(this.page, this.pageSize).subscribe({
      next: res => {
        this.orders = res.items;
        this.totalCount = res.totalCount;
        this.loading = false;
      },
      error: err => {
        this.error = 'Failed to load orders.';
        this.loading = false;
      }
    });
  }

  onPageChange(page: number) {
    if (page < 1 || page > this.totalPages) return;
    this.page = page;
    this.fetchOrders();
  }

  get totalPages() {
    return Math.max(1, Math.ceil(this.totalCount / this.pageSize));
  }
}
<div class="order-history-page">
  <h2>Order History</h2>
  <div *ngIf="loading">Loading orders…</div>
  <div *ngIf="error" class="order-error">{{ error }}</div>
  <div *ngIf="!loading && !error && !orders.length">No orders found.</div>
  <div *ngIf="orders.length">
    <div class="order-list">
      <div class="order-card" *ngFor="let order of orders">
        <div class="order-header">
          <b>Order #{{ order.id }}</b> <span class="date">({{ order.orderDate | date:'medium' }})</span>
        </div>
        <table class="order-items">
          <thead>
            <tr>
              <th>Product</th>
              <th>Quantity</th>
              <th>Price</th>
              <th>Subtotal</th>
            </tr>
          </thead>
          <tbody>
            <tr *ngFor="let item of order.items">
              <td>{{ item.productName }}</td>
              <td>{{ item.quantity }}</td>
              <td>₹{{ item.price }}</td>
              <td>₹{{ item.price * item.quantity }}</td>
            </tr>
          </tbody>
        </table>
      </div>
    </div>
    <div class="pagination" *ngIf="totalPages > 1">
      <button (click)="onPageChange(page-1)" [disabled]="page === 1">Prev</button>
      <span>Page {{page}} of {{totalPages}}</span>
      <button (click)="onPageChange(page+1)" [disabled]="page === totalPages">Next</button>
    </div>
  </div>
</div>
